import React, { Component } from 'react';

export default class TaskList extends Component {
    render() {
        let checklist = this.props.tasks.map((task, index) => {
            const checkboxCheck = (taskTitle) => {
                if (taskTitle === undefined) {
                    return null
                } else return (
                    <div className="checkbox__container">
                        <label className="taskLabel" htmlFor="checkbox-label">{task.taskTitle}</label>
                        <input type="checkbox" className="checkbox" id="checkbox" />
                        {/* <span className="checkmark"></span> */}
                    </div>
                )
            };
            const checkbox = checkboxCheck(task.taskTitle);
                return (
                    <li key={index} className="checkbox-container">
                        {checkbox}
                    </li>
                );
        })

       return(
           <div className="TaskList">
                <ul className="TaskList__list">{checklist}</ul>
            </div>
        )
    }
}
